
export interface Disease{
    image: string
    disease_name: string
    disease_id: number
}

export interface DiseasesResult {
    resultCount: number
    results: Disease[]
}


const DiseasesMock: Disease[] = [
    {
        disease_name: "CADASIL-синдром",
        disease_id: 1,
        image: "",
    },
    {
        disease_name: "Агнозия",
        disease_id: 2,
        image: "",
    },
    {
        disease_name: "Акатизия",
        disease_id: 3,
        image: "",
    }

]


export const getDisease = async (name = ''): Promise<Disease[]> =>{

    return fetch(`/api/diseases/?disease_name=${encodeURIComponent(name)}`, {
        method: 'GET',
        }) 
        .then((response) => response.json())

        .catch((error) => {
            if (name){
                const filteredArray = DiseasesMock.filter(DiseasesMock => DiseasesMock.disease_name.includes(encodeURIComponent(name)));
                return filteredArray
            }
            console.log(error);
            return DiseasesMock;
        });

}

